import React from 'react'
import Meta from '../../components/Meta'

const NotFound = () => {
    return (
        <>
      <Meta title='Page Not Found'/>
      <h1 className='text text-center'>404 - Page Not Found</h1>
    </>
    )
}

export default NotFound
